import React from 'react'
import { Container, Image } from 'react-bootstrap'
import './SellerDashboard.css';
import Logo from '../../images/capriconWhite.png';
import dashboardBG from '../../images/dashboardBG.png'

function SellerDashboard() {
    return (
        <div class="d-flex flex-row min-vh-100">
            <div class="dashboardMenu">
                <div
                    className="sidebar-background"
                    style={{
                        backgroundImage: `url(${dashboardBG})`
                    }}
                />
                <Image src={Logo} className="my-4 px-xl-4 px-lg-3" style={{ width: 200}} fluid />
                <span className="Logo-LineSeperator" />
            </div>
            <div class="p-2 dashboard">
                <Container>
                    Flex item 2
                </Container>
            </div>
        </div>
    )
}

export default SellerDashboard
